import React from "react";
import * as Style from "../styled";

function Header() {
  return (<>
    <Style.Header>
      <Style.HeaderSectionL>홈</Style.HeaderSectionL>
      <Style.HeaderSectionR>모두의 투두리스트</Style.HeaderSectionR>
    </Style.Header>
  </>
  );
}

export default Header;
